import React, { Component } from 'react';
import Input from './Fieldset';

class Education extends Component {
    render() {
        return (
            <fieldset>
                <legend>Education</legend>
                <Input name="School Name" />
                <Input name="City" />
                <Input name="Subject" />
                <Input name="From" />
                <Input name="To" />
            </fieldset>
        )
    }
}

export default Education;
